import style from "./Courses.module.css";

function coursesLessons(props) {
  console.log(props);
  return (
    <div className={style.container}>
      <div>
        <div className={style.introduction}>
          {props.username + ", great day to learn something new!"}
          <div className={style.subIntroduction}>Choose your first course</div>
        </div>
      </div>
      <div></div>
      <div>
        {props.lessons ? (
          props.lessons.map((p) => (
            <div key={p._id} className={style.courseName}>
              {p.lessonName}
            </div>
          ))
        ) : (
          <div>Привет</div>
        )}
      </div>
    </div>
  );
}
export default coursesLessons;
